class Solution(object):
    def minOperations(self, nums, k):
        """
        :type nums: List[int]
        :type k: int
        :rtype: int
        """
        nums = sorted(nums)
        addedNums = []
        operationCount = 0
        while True:
            if len(nums) > 0:
                if nums[0] >= k and len(addedNums) == 0:
                    break
            # print(nums, addedNums)
            if len(addedNums) == 0:
                x, y = nums.pop(0), nums.pop(0)
            elif len(addedNums) == 1:
                if len(nums) >= 2:
                    if addedNums[0] < nums[1]:
                        x, y = nums.pop(0), addedNums.pop(0)
                    else:
                        x, y = nums.pop(0), nums.pop(0)
                else:
                    x, y = nums.pop(0), addedNums.pop(0)
            else:
                if len(nums) >= 2 and nums[1] < addedNums[0]:
                    x, y = nums.pop(0), nums.pop(0)
                elif len(nums) >= 1 and addedNums[1] < nums[0]:
                    x, y = addedNums.pop(0), addedNums.pop(0)
                elif len(nums) >= 1:
                    x, y = nums.pop(0), addedNums.pop(0)
                else:
                    x, y = addedNums.pop(0), addedNums.pop(0)
            newNum = min(x, y) * 2 + max(x, y)
            if newNum >= k:
                nums.append(newNum)
            else:
                addedNums.append(newNum)
            # print(nums, addedNums)
            operationCount += 1
        return operationCount


